import React from "react";
import { useLocation, useNavigate, Link } from "react-router-dom";

function Home() {
  const location = useLocation();
  const history = useNavigate();

  return (
    <div className="homepage" style={styles.container}>
      <nav style={styles.navbar}>
        <ul style={styles.navList}>
          <li style={styles.navItem}>
            <Link to="/home" style={styles.navLink}>
              Home
            </Link>
          </li>
          <li style={styles.navItem}>
            <Link to="/services" style={styles.navLink}>
              Services
            </Link>
          </li>
          <li style={styles.navItem}>
            <Link to="/contact" style={styles.navLink}>
              Contact
            </Link>
          </li>
        </ul>
      </nav>

      <h1 style={styles.header}>Hello {location.state.id} and welcome to the home</h1>
    </div>
  );
}

const styles = {
  container: {
    textAlign: "center",
    color: "#fff",
    backgroundColor: "#333",
    fontFamily: "Arial, sans-serif",
    minHeight: "100vh",
    padding: "20px",
  },
  navbar: {
    marginBottom: "20px",
  },
  navList: {
    listStyleType: "none",
    padding: "0",
    margin: "0",
    display: "flex",
    justifyContent: "center",
  },
  navItem: {
    marginRight: "20px",
  },
  navLink: {
    textDecoration: "none",
    color: "#fff",
    fontSize: "1.2em",
  },
  header: {
    fontSize: "2.5em",
  },
};

export default Home;
